pragma solidity ^0.8.0;



contract UmiversePayment {
    address public owner;
    address public rewardPoolAddress;
    address public signerAddress;

    IERC20 public usdcToken;

    event PaymentSent(address indexed recipient, uint256 orderId, uint256 amount, bytes _signature);
    event TokensWithdrawn(uint256 amount);

    struct Order {
        address recipient;
        uint256 orderId;
        uint256 amount;
        uint256 fee;
        uint256 timestamp;
    }

    mapping(uint256 => Order) public orders;
    uint256 public nextOrderId = 1;

    constructor(address _usdcTokenAddress, address _rewardPoolAddress, address _signerAddress) {
        owner = msg.sender;
        rewardPoolAddress = _rewardPoolAddress;
        signerAddress = _signerAddress;
        usdcToken = IERC20(_usdcTokenAddress);
    }
    // config
    function config(address _usdcTokenAddress, address _rewardPoolAddress, address _signerAddress) public onlyOwner{
        rewardPoolAddress = _rewardPoolAddress;
        signerAddress = _signerAddress;
        usdcToken = IERC20(_usdcTokenAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    function sendUSDC(address from, address recipient, uint256 orderId, uint256 amount, uint256 _timestamp, bytes memory _signature) external {
        require(amount > 0, "Invalid amount");
        require(from != address(0), "CV: from to the zero address");
        require(
            verify(
                from,
                recipient,
                orderId,
                amount,
                _timestamp,
                _signature
            ),
            "CV: invalid _signature"
        );
        require(usdcToken.transferFrom(from, address(this), amount), "USDC transfer failed");

        uint256 developerFee = amount / 100; // 1% fee
        uint256 recipientAmount = amount - developerFee;

        usdcToken.transfer(rewardPoolAddress, developerFee);
        usdcToken.transfer(recipient, recipientAmount);

        orders[orderId] = Order(recipient, orderId, recipientAmount, developerFee, _timestamp);
        nextOrderId += 1;

        emit PaymentSent(recipient, orderId, recipientAmount, _signature);
    }

    function withdrawTokens(uint256 amount) external onlyOwner {
        require(amount > 0, "Invalid amount");
        require(usdcToken.transfer(owner, amount), "Token transfer failed");
        emit TokensWithdrawn(amount);
    }


    // signer
    function getMessageHash(
        address _from,
        address _recipient,
        uint256 _orderId,
        uint256 _amount,
        uint256 _timestamp
    ) public pure returns (bytes32) {
        return
            keccak256(
                abi.encodePacked(
                    _from,
                    _recipient,
                    _orderId,
                    _amount,
                    _timestamp
                )
            );
    }

    //verify(_buyer, _seller, _tokenid, _price, _amount, _timestamp, _signature
    function verify(
        address _from,
        address _recipient,
        uint256 _orderId,
        uint256 _amount,
        uint256 _timestamp,
        bytes memory _signature
    ) internal view returns (bool) {
        bytes32 messageHash = getMessageHash(
            _from,
            _recipient,
            _orderId,
            _amount,
            _timestamp
        );
        bytes32 ethSignedMessageHash = getEthSignedMessageHash(messageHash);
        return recoverSigner(ethSignedMessageHash, _signature) == signerAddress;
    }

    function getEthSignedMessageHash(bytes32 _messageHash)
        internal
        pure
        returns (bytes32)
    {
        return
            keccak256(
                abi.encodePacked(
                    "\x19Ethereum Signed Message:\n32",
                    _messageHash
                )
            );
    }

    function recoverSigner(
        bytes32 _ethSignedMessageHash,
        bytes memory _signature
    ) internal pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);
        return ecrecover(_ethSignedMessageHash, v, r, s);
    }

    function recoverSignerPublic(
        bytes32 _ethSignedMessageHash,
        bytes memory _signature
    ) public pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);
        return ecrecover(_ethSignedMessageHash, v, r, s);
    }

    function isTokenSupported(string memory token) public pure returns (bool) {
        return (compareStrings(token, "usdt") ||
            compareStrings(token, "usdc") ||
            compareStrings(token, "umi") ||
            compareStrings(token, "divepoint") ||
            compareStrings(token, "eth"));
    }

    function compareStrings(string memory a, string memory b)
        internal
        pure
        returns (bool)
    {
        return (keccak256(abi.encodePacked(a)) ==
            keccak256(abi.encodePacked(b)));
    }

    function splitSignature(bytes memory sig)
        internal
        pure
        returns (
            bytes32 r,
            bytes32 s,
            uint8 v
        )
    {
        require(sig.length == 65, "invalid signature length");
        assembly {
            r := mload(add(sig, 32))
            s := mload(add(sig, 64))
            v := byte(0, mload(add(sig, 96)))
        }
    }
}

